import React from "react";
import { Fname } from "./App";

const ComC = () => {
    return (
        <>
           <Fname.Consumer>{()=>{
            <h1>Hello World!   {Fname}</h1>
           }}</Fname.Consumer>
            <p> Flare On Top</p>
        </>
    )
}

export default ComC;
